INSERT INTO public.collections VALUES ('1', '0xd26f090e41f00596c979185725c7c6e69dc61316', 'Easter Bunny Oregin', 'This collection of 2000 Easter bunnies, is focused on the Oregin of the chocolate-egg laying mammal....we concluded that the Easter Bunny most likely is hatched from a chocolate egg.......................... There''s actually a lot of history behind the idea of an egg-bearing rabbit on Easter Sunday.......The Origin of the Easter Bunny ( Easter Rabbit / Easter Hare) is a folkloric figure and symbol of Easter, depicted as a rabbit—sometimes dressed with clothes—bringing Easter eggs. Originating among German Lutherans, the "Easter Hare" originally played the role of a judge, evaluating whether children were good or disobedient in behavior at the start of the season of Eastertide. As part of the legend, the creature carries colored eggs in its basket, as well as candy, and sometimes toys, to the homes of children. As such, the Easter Bunny. The custom was mentioned in Georg Franck von Franckenau''s in 1682, referring to a German tradition of an Easter Hare bringing eggs for the children.
