INSERT INTO public.collections VALUES ('1', '0xf89ca810ac949389f24b0b11672a4176f378e51a', 'BatFanVIP', 'The concept behind the NFT identity for SXSW 2022 is ''the action of coming together.'' We commissioned artist Marcos Abdallah to create a limited-edition NFT to bring this theme to life at the BCL_Web3_Dinner. ''I wanted to create a hyped character, full of positive energy and excitement to finally be able to attend SXSW after having two consecutive years of remote experiences. The bat is one of the symbols of Austin and now the BatFan is SXSW’s biggest and most excited fan'' - Marcos Abdallah On behalf of Blockchain Creative labs we wanted to thank you for attending. We hope you enjoy the NFT minted in the frame and on the blockchain as a way to remember this occasion. - Blockchain Creative Labs Team', 'VIPBF', 'batfanvip', 'ERC1155', '', 'https://lh3.googleusercontent.com/fbN8CFsM9Kvz56AEOPpq_SZWGpn4QkWgH4tMMH5hBzsAB8QJHLTybQROe5oCSWISe5NW0R_c0uxolVrq4PCrhouF4EeM7r8kxmGMcQ=s120', '2022-03-19 14:46:22.206074', NULL);
