INSERT INTO public.collections VALUES ('1', '0x6dddb0d63f5e12fdb18113916bb3c6d67688024a', '52icons - Rainer Hosch Genesis', 'I was 11 when my father died. From the early days in his photo darkroom, I learned that photography is all about creating connections. My father Heinz Hosch was my icon. A photojournalist, brave and without fear, a world traveler, risking his life at many front lines, from Vietnam to Western Africa, always there to capture the one photo that told the story. He was my first teacher and I lost him at the age of 52. He was not killed in these wars but in the end I believe it was the wars that killed him. On March 11th, I was able to celebrate my 52nd birthday, the age he was when he so unexpectedly passed away in 1981. This is when I made a decision that would change the course of my life: I would keep his cameras, become a photographer, and continue his legacy. “52icons” is a personal collection of portraits that capture some of the most famous faces of our time, including my father, forever in my heart and now forever living on the blockchain. Thank you, Vati, my icon.', '52i', '52icons-rainer-hosch-genesis', 'ERC1155', 'http://www.rainerhosch.com', 'https://lh3.googleusercontent.com/jEEIUNZAQ-g1ORoVdeVhOwpvqNLwsZCzZNdot8QTRSYC4b0EB4OViWXL8f6fv9s0lXEzJZPhpCKnb84NINYYBpII97NTvSFE3RT_aS4=s120', '2022-03-19 14:48:29.159744', NULL);
