As eluding as a shadow in the night,

Often lost in the translation of busy-ness or

the business of soul sucking endeavors,

the endless need to be needed,

the capitol chase of capitalizing on the false gratification of

our rotten desires.

But what does it mean to interact?

Is it a glance, a smile, a shift of an eyebrow?

Or an infinite moment of passion,

a deep smothering of embrace,

an encounter so metaphysically, undeniably, intangibly,

exquisite?

Or maybe it’s impossible.

It’s so hard to interact because it feels as though,

It’s an act

An act to act like I’m okay

Or an act like I’m acting like I know the right things to say

Instead, I’d rather disengage from the narrative that I need to be a certain way

To succeed is to be something that I can’t be

Right now…

I feel like interacting with nobody,

Especially the truly disturbing, lost soul, that is me

I’d rather disguise my pain and shame with a smile and

Carry on with a distorted version of myself

Never revealing my truth.

But maybe by fate, an interaction comes to play

One so profound, so utterly, unapologetically, enthusiastically,

Soulful.

One that simply cannot be ignored

One that outlasts the sands of time, and

Intertwines my hermetic vices into something more comprehensible

Something elegant, tangible, alive,

Something that no longer makes me feel so fucking dead inside

Something so revealing,

Yet cryptic enough to bare my sanity.

Simply put,

A Soulful Interaction on display.', 'SOULFUL', 'soulful-interactions-a-sand-dune-study-in-color-by', 'ERC721', 'https://sloika.xyz/mstompin.eth/soulful-interactions', 'https://lh3.googleusercontent.com/WW2ozGicEJI_d7lw9aRD8bMnMMbgyNLqLlA78-VOGi0cSZa0gzB-ONET51KUtik0oqa9GgSi5TM96LQLFk0PjUMMp0E9c1Z8WxmUBA=s120', '2022-03-19 14:45:34.97246', NULL);

