I stayed in Paris for two months from January of this year.
Paris was always crowded with tourists, but this time is very quiet due to covid19, so I was spend more leisurely time.

Many people say that Paris of summer is better, but I like Paris of winter.
There are a lot of clouds and it is spread low enough to touch.
It makes all the sunlight is blocked and it turns into a gray city, so that''s why the bright blue sky comes to me as a precious feeling.

As the City of Lights, when all the lights turn on at dusk, it’s time to start the night of Paris which is brighter than the daytime.
At that time, sitting on the terrace of a cafe, smoking and drinking hot chocolate
, I feel a sense of relaxation that I couldn''t feel in Korea.

I want share about the daily life of Paris what I saw and felt.
Feel the Paris winter, colors, scents and emotions.

